import React from "react";
import './Projects.css'; // Importing CSS for Projects component
import './Transitions.css'; // Importing Transitions CSS

const Projects = () => {
  return (
    <div className="projects-section">
      <h1>My Projects</h1>
      <p>
        Here are some of the projects I have worked on:
        {/* List of projects can be added here */}
      </p>
    </div>
  );
};

export default Projects;
